import React from "react";

function Card(props) {
  return (

    <div className="card text-center">
        <center>
      <div className="card-header">
        <h2>{props.heading}</h2>
      </div>
      <div className="card-body">{props.children}</div>
      </center>
    </div>

  );
}


export default Card;
